import Card from "react-bootstrap/Card"
import Container from "react-bootstrap/Container"

function CardList({ data }){

    console.log(data)
    return (
        <Container>
            {Object.keys(data).map((keyName, i) => (
                <Card>
                    <Card.Body>
                        <Card.Title>Hello</Card.Title>
                    </Card.Body>
                </Card>
            ))}
        </Container>
    )
}


export default CardList
